import React from "react";

const Table = ({ tableMetaData }) => {
  return (
    <div className="mt-5">
      <table className="table">
        <thead>
          <tr>
            {tableMetaData.map((x, i) => (
              <th key={i} scope="col">
                {x.headerTitle}
              </th>
            ))}
          </tr>
        </thead>
        {/* <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody> */}
      </table>
    </div>
  );
};

export default Table;
